const $ = cheerio.load(html)
const pics = $('figure.thumb').slice(0, 20)
let arr = []
pics.each(function() {
  const previewUrl = $(this).find('a.preview').attr('href')
  const ext = $(this).find('span.png').length > 0 ? 'png' : 'jpg'
  const hash = (() => {
    const res = previewUrl?.match(/(?<=\/w\/).*/)
    if(res) {
      return res[0]
    }
    return ''
  })()
  const hashHead = hash.slice(0,2)
  let url = previewUrl
  url = url?.replace(/wallhaven.cc/, 'w.wallhaven.cc')
  url = url?.replace(/\/w\//, `/full/${hashHead}/wallhaven-`)
  url += `.${ext}`
  arr.push({
    previewUrl,
    ext,
    name: hash,
    url,
  })
})

console.log(arr);


